import './App.css';
import SearchBar from './components/SearchBar.jsx';
import DayDisplay from './components/DayDisplay.jsx';

function App() {
  return (
    <div className="App bg-yellow-50 h-screen font-sans">
        <h1 className="text-6xl">Day component</h1>
        <DayDisplay/>
        <div className="p-6">
        <SearchBar />
        </div>
    </div>
  );
}

export default App;
